mapper.select:

select 

from FCRMOUT
where FCRMOUT_TXDATE = #{fcrmoutTxdate,jdbcType=CHAR}
  and FCRMOUT_BRNO = #{fcrmoutBrno,jdbcType=CHAR}
  and FCRMOUT_FEPNO = #{fcrmoutFepno,jdbcType=CHAR}

mapper.delete:

delete from FCRMOUT
where FCRMOUT_TXDATE = #{fcrmoutTxdate,jdbcType=CHAR}
  and FCRMOUT_BRNO = #{fcrmoutBrno,jdbcType=CHAR}
  and FCRMOUT_FEPNO = #{fcrmoutFepno,jdbcType=CHAR}
